// Headeruser.jsx
import React from 'react';

function Headeruser() {
  return (
    <div style={{
      width: '100%',
      height: '260px', // Taille réduite
      backgroundColor: '#e6f0fa', // Bleu très clair
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      flexDirection: 'column',
      color: '#2c3e50', // Bleu foncé/gris élégant
      textAlign: 'center',
      borderBottom: '2px solid #d0e3f0',
      boxShadow: '0 2px 6px rgba(0, 0, 0, 0.05)',
    }}>
      <h1 style={{ margin: 0, fontSize: '2rem', fontWeight: '600' }}>
        Espace Personnel
      </h1>
      <p style={{ fontSize: '0.95rem', marginTop: '8px', color: '#3f5873' }}>
        Gérer mes informations personnelles
      </p>
    </div>
  );
}

export default Headeruser;
